import Grid from '@mui/material/Grid';
import DrawerLayout from '../../layout/Drawer/DrawerLayout';



const Vaults = () => {
  return (
    <>
    <DrawerLayout>
    <h1 className='title'>Historial</h1>

    <label>Armado</label>
    <label>Retiro</label>
    
    </DrawerLayout>
    </>
  )
}

export default Vaults
